import React from 'react';
import { Link } from 'react-router-dom';

import HeaderLogo from './HeaderLogo';

function ProjectHeader() {
  return (
    <header>
      <div className="container">
        <div className="inner-header">
          <div className="background"></div>
          <div className="header-left">
            <Link exact path="/">
              <HeaderLogo color={'#888'} />
            </Link>
          </div>
          <nav className="header-center">
            <Link
              activeClass="active"
              to="/"
              spy={true}
              smooth={true}
              offset={-80}
              duration={500}
            >
              About
            </Link>
            <Link
              activeClass="active"
              to="work"
              spy={true}
              smooth={true}
              offset={-80}
              duration={500}
            >
              Work
            </Link>
            <Link
              activeClass="active"
              to="experience"
              spy={true}
              smooth={true}
              offset={-80}
              duration={500}
            >
              Experience
            </Link>
            {/* <Link
              activeClass="active"
              to="contact"
              spy={true}
              smooth={true}
              offset={-60}
              duration={500}
            >
              Contact
            </Link> */}
          </nav>
          <div className="header-right"></div>
        </div>
      </div>
    </header>
  );
}

export default ProjectHeader;
